using Fsharp.Solutions;
using Microsoft.FSharp.Collections;

namespace Inputs;

public class Input17 : AbstractInput<FSharpList<Day17.Direction>, FSharpList<Day17.Direction>>
{
    protected override FSharpList<Day17.Direction> ParseInput(string input) =>
        ListModule.OfSeq(
            input.ToCharArray()
                .Select(
                    c => c switch
                    {
                        '<' => Day17.Direction.Left,
                        '>' => Day17.Direction.Right
                    }));

    protected override FSharpList<Day17.Direction> ParseInputTwo(string input) => ParseInput(input);

    protected override long SolveFirstPuzzle(FSharpList<Day17.Direction> input) => Day17.firstPuzzle(input);

    protected override long SolveSecondPuzzle(FSharpList<Day17.Direction> input) => Day17.secondPuzzle(input);

    public override string TestInput => ">>><<><>><<<>><>>><<<>>><<<><<<>><>><<>>";
